import React from 'react';
import './Profile.css';
import { Grid } from '@mui/material';

function Profile({followersList}) {
  return (
    <div>
        <Grid container>
            <Grid item xs={3}>
                <div>
                    <ul>
                        {followersList.map(follower => (
                            <li id='follower.id'>follower.uid</li>
                        )
                        )}
                    </ul>
                </div>
            </Grid>
            <Grid item xs={3}>following</Grid>
        </Grid>
    </div>
  )
}

export default Profile
